import test from 'ava';

let pkg;

if( global.__AVA_SOURCE__ === 'es5-monolith' ){
	await import(`../../dist/es5-monolith.js`);
	pkg = global.annex.conversion;
} else {
	pkg = await import(`../../${global.__AVA_SOURCE__}/conversion.js`);
}

const {
	toBaseX,
	fromBaseX
} = pkg;



const WORST_CASE = {
	value : `
		this is absurdly long test content which will be encoded using a special charset made for readability

		additionally we are torturing the algo with Ümläutß, Űńíćődé stuff and whitespace

		すべての人間にんげんは、生うまれながらにして自由じゆうであり、かつ、尊厳そんげんと権利けんりとについて平等びょうどうである。
		人間にんげんは、理性りせいと良心りょうしんとを授さずけられており、
		互たがいに同胞どうほうの精神せいしんをもって行動こうどうしなければならない。

		Fugiat consequat magna eiusmod pariatur sint mollit tempor eiusmod irure do officia laborum magna consectetur
		ex adipisicing do eu enim aliqua aute mollit incididunt occaecat sit consectetur sunt aliquip qui cupidatat
		velit nulla eiusmod ullamco et magna eu consectetur ipsum aute mollit amet non consequat ex ut reprehenderit
		exercitation quis commodo velit esse labore quis sunt labore pariatur laboris aliqua nulla quis ea adipisicing
		consectetur irure mollit eiusmod aute anim adipisicing ut magna magna ullamco reprehenderit anim occaecat ex
		anim mollit laborum excepteur in do eu laboris enim est sunt amet laborum qui reprehenderit anim non laboris
		ea exercitation nisi.
	`,
	alphabet : 'ACDEFGHKLMNPQRSTUVWXYZ2345679',
	charMapResult : '',
	chunkedResult : ''
};



test('toBaseX', assert => {
	assert.is(toBaseX('foobar'), 'Zm9vYmFy');
	assert.is(toBaseX('//////'), 'Ly8vLy8v');
	assert.is(toBaseX('ÿÿÿ'), 'w7/Dv8O/');
	assert.is(toBaseX('äす', 36), '16W33YPUS');
	assert.is(toBaseX(42, 10), '42');
	assert.is(toBaseX(-42, '0123456789'), '-42');
	assert.is(toBaseX(42, ['56789', '012', '4', '3']), '42');
	assert.is(toBaseX(42, 'abcdefghij'), 'ec');
	assert.is(toBaseX(-5, 2), '-101');
	assert.is(toBaseX(5, ['0', '1']), '101');
	assert.is(toBaseX(5, ['1', '0']), '101');
	assert.is(toBaseX(140, 8), '214');
	assert.is(toBaseX(-666, 13), '-3C3');
	assert.is(toBaseX(110, 16), '6E');
	assert.is(toBaseX(42, 64), 'q');
	assert.is(toBaseX(-42, 64), '-q');
	assert.is(toBaseX('42', 64), 'NDI');
	assert.is(toBaseX(0xff, 16), 'FF');
	assert.throws(() => { toBaseX(66, 1); });
	assert.throws(() => { toBaseX(66, 65); });
	assert.notThrows(() => { toBaseX(66, 64); });
	assert.throws(() => { toBaseX(66, ['a']); });
	assert.throws(() => { toBaseX(66, 'a'); });
	assert.throws(() => { toBaseX('too-long-for-number-conversion', 36); });
	assert.is(toBaseX('too-long-for-number-conversion', 36, true), 'U70R0DCN0F0DS04T0BQ040R0GCN0N0JSNA03TZ0J01S0K0N0KQOA0HRN0R0C');
	assert.is(toBaseX('too-long-for-number-conversion', 36, false, true), 'I148ZRU0U2W9MNW0FYJVW1J0YSDJ8SA0HOKBYU10YSODEU305M6O2');
	assert.is(toBaseX('too-long-for-number-conversion', 16, true), '1CB4B3805153A381A2A1B36182A4B3B0515473E1A15E291B263E271A3F473F1816E3C19154B37');
	assert.is(toBaseX('too-long-for-number-conversion', 16, false, true), 'D3EF5D81F026D9DFDA970BBF17222402A47D5AD650CF6C2FE2102A494BCBDD0A2864C');
	assert.is(toBaseX('too-long-for-number-conversion', 12, true), '3B0633700B0B2A11700B39583A00937583371180B2A22911B392A09573A4A11B4B39226229226372B09119382A33700A');
	assert.is(toBaseX('too-long-for-number-conversion', 12, false, true), '2339AA3292203182917497102184165B6A50354887B45A5022BB98811530354969A876B04AAB5A3');
	assert.is(toBaseX('too-long-for-number-conversion', 2, true), '');
	assert.throws(() => { toBaseX('too-long-for-number-conversion', 2, false, true); });
	assert.is(toBaseX('too-long-for-number-conversion', ['c', 0, 1], false, true), '11101000110111101101111001011010110c110001101111011011100110011100101101c11001100110111101110010001011010110c111001110101011011010110001001100101c11100100010110101100011011011110110c111001110110011001010111001001110011c11010010110111101101110');
	assert.is(toBaseX(WORST_CASE.value, WORST_CASE.alphabet, true), WORST_CASE.charMapResult);
	assert.is(toBaseX(WORST_CASE.value, WORST_CASE.alphabet, false, true), WORST_CASE.chunkedResult);
	assert.is(toBaseX(WORST_CASE.value, 'a0b1c2d3', true), '');
	assert.is(toBaseX(WORST_CASE.value, 'a0b1c2d3', false, true), '');
	assert.is(toBaseX(WORST_CASE.value, 2, true), '');
	assert.is(toBaseX(WORST_CASE.value, 'x42', false, true), '');
	// crypto.getRandomValues(new Uint16Array(3)).reduce((sum, v) => sum + v, 0) + '' + (new Date()).toISOString().replace(/[\-T:.Z]/g, '?').split('?').reduce((sum, v) => sum + Number(v), 0)
	assert.is(toBaseX(1193972930, WORST_CASE.alphabet), 'DAHEPHN');
	assert.is(toBaseX('1193972930', WORST_CASE.alphabet, true), 'SZHCGSA6APCESANAPA6SD');
	assert.is(toBaseX('1193972930', WORST_CASE.alphabet, false, true), '9QLST4UAE7F37X4UA9R');
});



test('fromBaseX', assert => {
	assert.is(fromBaseX('Zm9vYmFy'), 'foobar');
	assert.is(fromBaseX('Ly8vLy8v'), '//////');
	assert.is(fromBaseX('w7/Dv8O/'), 'ÿÿÿ');
	assert.is(fromBaseX('16W33YPUS', 36), 'äす');
	assert.is(fromBaseX('{42}', 10), 42);
	assert.is(fromBaseX('-42', '0123456789', false, false, true), -42);
	assert.is(fromBaseX(42, ['56789', '012', '4', '3']), 42);
	assert.is(fromBaseX('{ec}', 'abcdefghij'), 42);
	assert.is(fromBaseX(-101, 2), -5);
	assert.is(fromBaseX('101', ['0', '1'], false, false, true), 5);
	assert.is(fromBaseX('{101}', ['1', '0']), 5);
	assert.is(fromBaseX(214, 8), 140);
	assert.is(fromBaseX('{-3C3}', 13), -666);
	assert.is(fromBaseX('{6E}', 16), 110);
	assert.is(fromBaseX('q', 64, false, false, true), 42);
	assert.is(fromBaseX('-q', 64, false, false, true), -42);
	assert.is(fromBaseX('NDI', 64), '42');
	assert.is(fromBaseX('{FF}', 16), 0xff);
	assert.throws(() => { fromBaseX(66, 1); });
	assert.throws(() => { fromBaseX(66, 65); });
	assert.notThrows(() => { fromBaseX(66, 64); });
	assert.throws(() => { fromBaseX(66, ['a']); });
	assert.throws(() => { fromBaseX(66, 'a'); });
	assert.is(fromBaseX('U70R0DCN0F0DS04T0BQ040R0GCN0N0JSNA03TZ0J01S0K0N0KQOA0HRN0R0C', 36, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX('I148ZRU0U2W9MNW0FYJVW1J0YSDJ8SA0HOKBYU10YSODEU305M6O2', 36, false, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX('1CB4B3805153A381A2A1B36182A4B3B0515473E1A15E291B263E271A3F473F1816E3C19154B37', 16, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX('D3EF5D81F026D9DFDA970BBF17222402A47D5AD650CF6C2FE2102A494BCBDD0A2864C', 16, false, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX('3B0633700B0B2A11700B39583A00937583371180B2A22911B392A09573A4A11B4B39226229226372B09119382A33700A', 12, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX('2339AA3292203182917497102184165B6A50354887B45A5022BB98811530354969A876B04AAB5A3', 12, false, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX('', 2, true), 'too-long-for-number-conversion');
	assert.throws(() => { fromBaseX('11101000110111101101111001011010110c110001101111011011100110011100101101c11001100110111101110010001011010110c111001110101011011010110001001100101c11100100010110101100011011011110110c111001110110011001010111001001110011c11010010110111101101110', 2, false, true); });
	assert.is(fromBaseX('11101000110111101101111001011010110c110001101111011011100110011100101101c11001100110111101110010001011010110c111001110101011011010110001001100101c11100100010110101100011011011110110c111001110110011001010111001001110011c11010010110111101101110', ['c', 0, 1], false, true), 'too-long-for-number-conversion');
	assert.is(fromBaseX(WORST_CASE.charMapResult, WORST_CASE.alphabet, true), WORST_CASE.value);
	assert.is(fromBaseX(WORST_CASE.chunkedResult, WORST_CASE.alphabet, false, true), WORST_CASE.value);
	assert.is(fromBaseX('', 'a0b1c2d3', true), WORST_CASE.value);
	assert.is(fromBaseX('', 'a0b1c2d3', false, true), WORST_CASE.value);
	assert.is(fromBaseX('', 2, true), WORST_CASE.value);
	assert.is(fromBaseX('', 'x42', false, true), WORST_CASE.value);
});
